// fetch data from propublica.org
async function fetchDataFromPropublicaOrgAPI(type) {
  return (
    await fetch(
      "https://api.propublica.org/congress/v1/113/" + type + "/members.json",
      {
        headers: { "X-API-Key": "PeoQrPJONEB0oy2bwTSlMvnliYvyCSCTOlEH5HPP" },
      }
    )
  ).json();
}

// refactor and move to logic.js
// get data from propublica.org, show fetch errors or return the correct data
async function getDataFromPropublicaOrgAPI(type) {
  try {
    const data = await fetchDataFromPropublicaOrgAPI(type);
    return data.results[0].members;
  } catch (error) {
    alert("Error! -> " + error);
  }
}

